import {Route, Switch, withRouter, Redirect, BrowserRouter} from 'react-router-dom';
import './App.scss';
import SRP from '../src/Containers/SRP';
import PrivacyPolicy from '../src/Containers/PrivacyPolicy';

function App() {
  let routes = (
    <BrowserRouter>
      <Switch>
          <Route path="/privacy-policy" component={PrivacyPolicy} />
          <Route path="/" exact component={SRP} />
          <Redirect to='/' />
      </Switch>
    </BrowserRouter>
  );

  return (
    <div className="App">
      {routes}
    </div>
  );
}

export default App;
